import React from 'react';

const RPHouse = ({ house }) => {
  return (
    <div className="house">
      <img src={house.image} alt={house.houseName} />
      <h3>{house.houseName}</h3>
      <p>Price range: {house.price}</p>
    </div>
  );
};

export default RPHouse;
